('7f2f326b-4385-3beb-244a-aea48a10ed18', 'PO-38707', 'Mollitia quaerat nostrum est ad error.', 'Animi tempora voluptatem est ut, vero quo nulla amet quos nihil sed et earum similique. Ab unde dolores ut, odio laudantium ducimus consequatur excepturi nostrum voluptate beatae sed eos vel? Officiis sed, accusamus tempora est deserunt quae blanditiis ipsa dolore vitae voluptate ut iusto natus.\r\nProvident ut, et veniam quia ut qui quibusdam et esse error nobis odio et ut; sit iste quibusdam porro, omnis obcaecati dolore molestiae ut at voluptates molestiae id rerum recusandae; est omnis possimus quod, quidem numquam corrupti et blanditiis commodi id aut doloribus ullam expedita.\r\nCupiditate amet et placeat nisi et dicta sint voluptatum sit deserunt natus aut quasi sed. Sit laborum earum aperiam non ipsam dolores corrupti sed architecto quia provident repudiandae et ex. Eos a aperiam delectus voluptatem quidem rerum omnis quis aperiam pariatur est vero asperiores labore? Natus aliquid sed aliquam aut est optio et culpa voluptatum iste in et quia et. Dicta blanditiis iste eaque voluptate alias dolorem error sint iure exercitationem voluptates sed dolorem ut. Illo doloremque perferendis quibusdam voluptatem unde autem accusamus ut in error aperiam omnis tempora quo...', 0, '6f77cf88-340e-5862-ec36-63d5d5eff719', '11452b0c-768e-5ff7-0d63-eeb1d8ed8cef', '2023-03-25 09:01:29', 'Hoàng Linh Anh', '2023-03-25 09:01:29', 'Nông Ánh Định'),
('7fc94edc-2827-7327-1f1e-21c6d80fbd76', 'PO-65537', 'Rerum magnam soluta autem et atque.', 'Autem similique blanditiis cupiditate est sit fugit rerum facilis impedit est atque enim numquam deleniti. Modi a fugiat omnis quos voluptatem voluptas sit omnis accusamus magnam distinctio non quod minus.\r\nDolores unde ea dicta vitae aliquid eveniet fuga quae qui explicabo voluptatem sed cumque consequatur. Nesciunt enim eligendi iste sit, quod voluptatem sit eos iste ut iste reiciendis veritatis doloribus. Facilis non quia ullam dolores tempore sequi delectus incidunt animi ex similique eum inventore atque! Accusantium et accusantium, voluptas ipsum libero ratione non eum nesciunt autem aperiam porro distinctio est. Omnis magnam distinctio voluptatem iste dicta fuga et voluptas ab omnis labore maiores eaque vero? Consequatur architecto optio doloremque similique, quibusdam ullam qui unde quia voluptas dolore velit quod sit. Culpa amet qui, dicta harum officia tenetur quia sed necessitatibus modi praesentium adipisci repudiandae tenetur; dicta iste natus, nemo sed unde ut error reiciendis aut molestias consequatur recusandae et modi; aut doloribus nam molestiae iusto, impedit neque et quisquam necessitatibus et ex qui autem laudantium.', 0, '48c0e033-30af-2811-89db-f21ac591aca5', '7686595d-16d5-33b3-0080-e8e2a817c80e', '2023-03-25 09:01:29', 'Nông Thị Anh', '2023-03-25 09:01:29', 'Tống Ánh Thoa');
